import * as common from './common';
export { common };
export interface ActionSend {
    /** action */
    ev_type: string;
    payload: ActionPayload;
    common: common.Common;
}
export interface ActionPayload {
    start_time: number;
    id: string;
    type: string;
    duration?: number;
    target: ActionTarget;
    frontend_time?: number;
    /** 自定义数值 string 对应 ev_type, 比如 http 、js_error */
    metrics?: {
        [key: string]: ActionRelatedDetail;
    };
}
export interface ActionTarget {
    /** 目标元素可获取到的信息。比如【确定】 【取消】 */
    name: string;
    path?: string;
}
export interface ActionRelatedDetail {
    count: number;
    duration?: number;
}
